import { useState } from "react"
import { useCallback } from "react"
import { useEffect } from "react"
import { useDispatch, useSelector } from "react-redux"
import { fetchOrder } from "../store/actions/shop-action"

const Order = () => {
  const authUser = useSelector(state => state.auth)
  const dispatch = useDispatch()

  const [listOrder, setListOrder] = useState([])

  const fetchListOrder = useCallback(async () => {
    const response = await dispatch(fetchOrder(authUser.customerId))
    setListOrder(response)
  }, [authUser.customerId, dispatch])
  useEffect(() => {
    fetchListOrder()
  }, [fetchListOrder])

  console.log(listOrder)
  return (
    <>
      <div class="ui middle aligned divided list">
        <div class="item">
          <div class="right floated content">
            <div class="ui button">View Order</div>
          </div>
          <img
            alt="This is image"
            class="ui avatar image"
            src="/images/avatar2/small/lena.png"
          />
          <div class="content">Lena</div>
        </div>
      </div>
    </>
  )
}

export default Order
